// This is just a block cipher
function f(L,R){
	x = parseInt(L);
	y = parseInt(R);
	block = ["1032547698",
	       	 "7215839046",
	       	 "9532817640",
	       	 "1094365872",
	       	 "6895730412",
	       	 "1074389256",
	       	 "5749208163",
	       	 "8976543201",
	       	 "2807694315",
	       	 "8746293105"];
	return block[y][x];
};

// An arbitrary hard-coded complicated function
function F(L,K){
	x = parseInt(L);
	k = parseInt(K);
	temp = ""+x*x*x*K*3+23*K*K*x*x*x+K*(x+K)+3;
	return temp.slice(4,10);
};

// The Feistel network
function feist_pass(input,k){
	L = input.slice(0,6);
	R = input.slice(6,12);
	var i;
	Rout="";
	temp = F(R,k);
	for(i=0;i<6;i++){
		Rout = Rout + f(L[i],temp[i]);
	}
	return R+Rout; 
};

// The key for the encryption is hard-coded.
key="248473";	
function scrambler(input){
	var i;
	for(i=0; i<key.length; i++){
		input  = feist_pass(input,key[i]);
	}
	return input;
};
function unscrambler(input){
	input = input.slice(6,12)+input.slice(0,6);
	var i;
	for(i=0; i<key.length; i++){
		input  = feist_pass(input,key[key.length-1-i]);
	}
	return input.slice(6,12)+input.slice(0,6);
};

function coord_to_words(coordinate){
	lat = parseFloat(coordinate[0]);
  	lon = parseFloat(coordinate[1]);
	//document.getElementById("output_text2").innerHTML= lat+" "+lon;

	// We truncate the coordinates to 5 d.p. and map to (0 padded) 7 character strings of digits. 
  	lat = Math.round(lat * 10000) +  900000;
  	lon = Math.round(lon * 10000) + 1800000;
  	lat = ('' + lat).padStart(7,'0');
 	lon = ('' + lon).padStart(7,'0');

	// lat is a most 1800000 and lon is at most 3600000
	// We keep the first digits for use as first digits of our word indices, thus making each index < 40k.
	lat0 = lat.slice(0,1);
	lon0 = lon.slice(0,1);
	//document.getElementById("output_text2").innerHTML= lat.slice(1,7)+lon.slice(1,7);

	// Now we scramble 14 digits making the bulk of the coordinates
	latlon_rest = scrambler(lat.slice(1,7)+lon.slice(1,7));
	//document.getElementById("output_text2").innerHTML= latlon_rest;
	//latlon_rest = lat.slice(1,7)+lon.slice(1,7);

	// We combine the inital digits we extracted earlier, with half 
	// of the scrambled digits to make a new scrambed (lat,lon)
	lat = lat0 + latlon_rest.slice(0,6);
	lon = lon0 + latlon_rest.slice(6,12);

	// The word indices are chosen so each is <40k.
  	ind1 = lat.slice(0,5);
  	ind2 = lon.slice(0,5);
  	ind3 = '0'+lat.slice(5,7) + lon.slice(5,7);

	//document.getElementById("output_text4").innerHTML= ind1 +" "+ ind2 + " " + ind3;
	//document.getElementById("output_text2").innerHTML= ilist[wlist[ind1]] +" "+ ilist[wlist[ind2]] + " " + ilist[wlist[ind3]];
	document.getElementById("output_text").innerHTML= wlist[ind1] +"."+ wlist[ind2] + "." + wlist[ind3];

	return"";
};

	ind2 = ilist[word[1]];
	ind3 = ilist[word[2]];
	lat = ind1 + ind3.slice(1,3);
	lon = ind2 + ind3.slice(3,5);
	lat0 = lat[0];
	lon0 = lon[0];
	latlon_rest = lat.slice(1,7) +lon.slice(1,7);
	latlon_rest = unscrambler(latlon_rest);
	lat = lat0 + latlon_rest.slice(0,6);
	lon = lon0 + latlon_rest.slice(6,12);
	lon = parseFloat(lon - 1800000)/10000.0;
	lat = parseFloat(lat -  900000)/10000.0;

	var coord = [lat,lon];	
	return coord;
};

</script>
